import "./style.css";
import "../../../gallery.css"
import projectArr from "./project-arr";

import ProjectBox from "./ProjectBox";
console.log(projectArr)
export default function Projects() {
  return (<div className="anchor-box"><a name="projects" href="/#">&nbsp;</a>

    <div id="project-container" className="box">
      <div id="project-box">
        <h1 id="project-h1">Coding Projects</h1>
        <div id="project-gallery" className="misc-gallery">
    <ProjectBox title="Drawing App" imgSrc="" desc="A simple drawing game made with canvas and javascript." link="https://github.com/piperbates/drawing-app" liveLink ="https://piperbates.github.io/drawing-app/"  />


    <ProjectBox title="Pokemon Card Generator" imgSrc="" desc="A random Pokemon card generator, created with PokeAPI and JS." link="https://github.com/piperbates/pokemon-card-generator" liveLink = "https://piperbates.github.io/pokemon-card-generator/" />


    <ProjectBox title="Rock Paper Scissors" imgSrc="" desc="The classic game, made with vanilla JS. My first JavaScript project." link="https://github.com/piperbates/rps" liveLink="https://piperbates.netlify.app/images/rps-ss.png" />
        </div>
      </div>
    </div>
    </div>
  );
}
